import './App.css';
import { Route, Routes } from 'react-router-dom';
import LoginPage from './components/auth/login';
import Home from './components/home';

function App() {
  return (
    <div className="App">
     <h1>Home page</h1>
	  <Routes>
		<Route>

		</Route>
		<Route path="/" element={<Home/>} />
		<Route path="/login" element={<LoginPage/>} />
	  </Routes>
    </div>
  );
}

export default App;
